import { Component } from 'react'
import Link from 'next/link'
import { Carousel } from 'react-responsive-carousel';


class Header extends Component {
  constructor() {
    super()
  }

  render(h) {
    return (
      <div className={'header'}>
          <div className={'header-carousel'}>

          </div>
      </div>
    );
  }
}

export default Header;
